    @classmethod
    def puk_kernel(cls, x1, x2, sigma=1.0, omega=1.0):

        """
          This function computes the kernel matrix between two arrays using the Pearson VII function-based universal
          kernel. It is taken from https://github.com/rlphilli/sklearn-PUK-kernel/blob/master/PUK_kernel.py. For more
          info, see https://doi.org/10.1016/j.chemolab.2005.09.003. Used as kernel function in SVC classifiers.

          | Pre-conditions: none.
          | Post-conditions: puk kernel is computed using the given data and parameters.
          | Main output: kernel matrix.

        :param x1: first data matrix
        :type x1: ndarray.
        :param x2: second data matrix.
        :type x2: ndarray.
        :param sigma: sigma parameter.
        :type sigma: float.
        :param omega: omega parameter.
        :type omega: float.
        :return: kernel matrix.
        :rtype: ndarray (n_samples, n_samples).
        :raise: none.
        """

        # Compute squared euclidean distance between each row element pair of the two matrices
        if x1 is x2:
            kernel = squareform(pdist(x1, 'sqeuclidean'))
        else:
            kernel = cdist(x1, x2, 'sqeuclidean')

        kernel = (1 + (kernel * 4 * np.sqrt(2 ** (1.0 / omega) - 1)) / sigma ** 2) ** omega
        kernel = 1 / kernel

        return kernel

